import React, { useEffect, useState } from 'react';
import axios from 'axios';

const apiUrl = 'http://localhost:8000/medical_store_app/';  // Ensure this is the correct URL

const PrescriptionForm = () => {
  const [medicines, setMedicines] = useState([]);  // Set initial state as an empty array
  const [formData, setFormData] = useState({
    patient_name: '',
    medicine: '',
    dosage: '',
    prescribed_by: '',
    prescription_date: '',
    instructions: '',
  });
  const [loading, setLoading] = useState(true);  // Track loading state
  const [error, setError] = useState('');  // Track any errors during fetching

  // Fetch medicines data from the backend
  useEffect(() => {
    axios
      .get(`${apiUrl}medicine/`)
      .then((response) => {
        // Log the response to debug
        console.log('Fetched Medicines:', response.data);
        
        // Ensure the response data is an array
        if (Array.isArray(response.data)) {
          setMedicines(response.data); // Store medicine data
        } else {
          setError('Error: Medicine data is not in expected format');
        }
        setLoading(false); // Set loading to false once data is fetched
      })
      .catch((error) => {
        setError('Error fetching medicines. Please try again later.');
        setLoading(false); // Set loading to false even in case of error
        console.error('Error fetching medicines:', error);
      });
  }, []);

  // Handle form data change
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    axios
      .post(`${apiUrl}prescription/`, formData)
      .then((response) => {
        alert('Prescription added successfully!');
        setFormData({
          patient_name: '',
          medicine: '',
          dosage: '',
          prescribed_by: '',
          prescription_date: '',
          instructions: '',
        });
      })
      .catch((error) => {
        console.error('Error adding prescription:', error);
        alert('There was an error adding the prescription.');
      });
  };

  // Render the loading, error, and form states
  return (
    <div>
      <h2>Add Prescription</h2>
      {loading ? (
        <p>Loading medicines...</p>
      ) : error ? (
        <p style={{ color: 'red' }}>{error}</p>
      ) : (
        <form onSubmit={handleSubmit}>
          <div>
            <label>Patient Name:</label>
            <input
              type="text"
              name="patient_name"
              value={formData.patient_name}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label>Medicine:</label>
            <select
              name="medicine"
              value={formData.medicine}
              onChange={handleChange}
              required
            >
              <option value="">Select Medicine</option>
              {medicines.map((medicine) => (
                <option key={medicine.id} value={medicine.id}>
                  {medicine.name}
                </option>
              ))}
            </select>
          </div>
          <div>
            <label>Dosage:</label>
            <input
              type="text"
              name="dosage"
              value={formData.dosage}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label>Prescribed By:</label>
            <input
              type="text"
              name="prescribed_by"
              value={formData.prescribed_by}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label>Prescription Date:</label>
            <input
              type="date"
              name="prescription_date"
              value={formData.prescription_date}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label>Instructions:</label>
            <textarea
              name="instructions"
              value={formData.instructions}
              onChange={handleChange}
              required
            ></textarea>
          </div>
          <button type="submit">Add Prescription</button>
        </form>
      )}
    </div>
  );
};

export default PrescriptionForm;
